import React from 'react';
import '../App.css';
import { useNavigate } from 'react-router-dom';
import Grid from '@mui/material/Grid';
// import axios from 'axios';
import {
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
} from '@mui/material';
import { styled } from '@mui/system';

import experiencesData from '../data/ExperienceData';

const Box = styled('div')(({ selected, id }) => ({
  display: 'flex',
  height: '100%',
  border: (selected === id) ? '3px solid #6D8472' : '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
}));

const Item = styled('div')({
  display: 'flex',
  flexDirection: 'column',
  padding: '10px',
});

const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center',
  cursor: 'pointer',
});

const PlanButton = styled('button')({
  width: '100%',
  margin: '30px',
  color: 'white',
  padding: '10px 10px',
  margin: '5px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center',
  cursor: 'pointer',
})

const ExperienceBox = ({ id, title, subtitle, description, items, selected }) => (
  <Grid item xs={4}>
    <Box selected={selected} id={id}>
      <Grid sx={{ flexGrow: 1, height: "100%" }} container spacing={2}>
        <Grid item xs={12} sx={{ height: "20%" }}>
          <Item className="subscription-head" id={id}>
            {subtitle && <Typography sx={{ fontSize: ".6rem" }}>
              {subtitle}
            </Typography>}
            <Typography sx={{ fontSize: "1.2rem" }}>
              {title}
            </Typography>
            <Typography sx={{ fontSize: ".6rem" }}>
              {description}
            </Typography>
          </Item>
        </Grid>
        <Grid item xs={12} sx={{ height: "500px", display: "flex", flexDirection: "column", justifyContent: "space-between" }}>
          <List sx={{ padding: "0", width: "100%", maxWidth: "500px"}}>
            {items.map((item, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemText
                    primary={item.primary}
                    secondary={
                      <>
                        {item.secondary && <Typography style={{ color: "#e8e5df", fontStyle:"italic", fontSize: ".7rem" }}>
                          {item.secondary}
                        </Typography>}
                        <Typography style={{ color: "#e8e5df", fontWeight:"lighter", fontSize: ".7rem"}}>
                          {item.details}
                        </Typography>
                      </>
                    }
                  />
                </ListItem>
                {index < items.length - 1 && <Divider variant="middle" component="li" sx={{ backgroundColor: "#6D8472" }} />}
              </React.Fragment>
            ))}
          </List>
          <PlanButton id={id}>Choose Plan</PlanButton>
        </Grid>
      </Grid>
    </Box>
  </Grid>
)

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();
  const [selected, setSelected] = React.useState("");

  const handleSelectPlan = (id) => {
    setSelected(id);
  }

  // this should save the experience selected.
  const goToProjects = () => {
    navigate('/projects')
  }

  return (
    <div sx={{ display: "flex", flexDirection: "column", alignContent: "center", justifyContent: "center"}}>
      <Container component="main" maxWidth="md" sx={{ display: "flex", flexDirection:"column", paddingBottom: "50px" }}>
        <Typography sx={{ fontSize: ".8rem", color: "#a7a396" }}>
          Step <b>1</b> of <b>3</b>
        </Typography>
        <Typography sx={{ fontSize: "1.75rem", fontWeight: "500" }}>
          Choose an Experience
        </Typography>
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          {experiencesData.map((experience) => (
            <ExperienceBox onClick={handleSelectPlan(experience.id)}  key={experience.id} {...experience} />
          ))}
        </Grid>
      </Container>
      <div style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
        <ProgButton onClick={goToProjects}>Next</ProgButton>
      </div>
    </div>
  );
}

export default Experiences;
